function registeredDetails({ reg }) {
    var skill = '';
    for (let index = 0; index < reg.skills.length; index++) {
        if(index = reg.skills.length-1)
        {
            skill = skill + reg.skills[index]
        }
        else{
            skill = skill + reg.skills[index] + ','
        }
        console.log('round')
        console.log(reg.skills.length)
    }
    return (
        <div>
            <p>{reg.name}</p>
            <p>{reg.email}</p>
            <p>{reg.gender}</p>
            <p>{skill}</p>
            <p>{reg.skills}</p>
        </div>
    )
  }
export default registeredDetails
